import axios from "axios";
import React from "react";
import { useState } from "react";

import {Link, useNavigate} from "react-router-dom";

export default function Navbar({ fixed }) {
  const [navbarOpen, setNavbarOpen] = useState(false);
  const [userData, setUserData] = useState({});
  const [toggle, setToggle] = useState({
    loginBtn: true,
    logOutBtn: false
  });
  const navigate = useNavigate();

  // useEffect(() => {
  //   const fetchUserData = async () => {
  //     try {
  //       const token = localStorage.getItem('token');
  //       if (token) {
  //         const response = await axios.get('http://localhost:8000/api/user/login/user-details', {
  //           headers: {
  //             authorization:token,
  //           },
  //         });

  //         if (response.status === 200) {
  //           setUserData(response.data);
  //         }
  //       }
  //     } catch (error) {
  //       console.error('Error fetching user data:', error);
  //     }
  //   };

  //   fetchUserData();
  // }, [userData]);
  console.log(toggle);
  const handleLogin = async () => {
    navigate(`/login`);
    try {
      const token = localStorage.getItem('token');
      if (token) {
        const response = await axios.get('http://localhost:8000/api/user/login/user-details', {
          headers: {
            authorization:token,
          },
        });

        if (response.status === 200) {

          setUserData(response.data);
          setToggle({
            loginBtn: false,
            logOutBtn: true
          })
        }
      }
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  const handleLogout = async () => {
    try {
      // Clear the token from localStorage
      localStorage.removeItem('token');
      setToggle({
        loginBtn: true,
        logOutBtn: false
      })
      navigate(`/`);
    } catch (error) {
      console.error('Logout failed:', error);
    }
  }

  return (
    <>
      <nav className="relative flex flex-wrap items-center justify-between px-2 py-3 bg-teal-500 mb-3">
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
            <Link
              className="text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap uppercase text-white"
              to={"/"}
            >
              Mama Blog
            </Link>
            <button
              className="text-white cursor-pointer text-xl leading-none px-3 py-1 border border-solid border-transparent rounded bg-transparent block lg:hidden outline-none focus:outline-none"
              type="button"
              onClick={() => setNavbarOpen(!navbarOpen)}
            >
              <i className="fas fa-bars"></i>
            </button>
          </div>
          <div
            className={
              "lg:flex flex-grow items-center" +
              (navbarOpen ? " flex" : " hidden")
            }
            id="example-navbar-danger"
          >
            <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
              <li className="nav-item">
                 <Link
                  className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                  to={"/dashboard"}
                >
                  <i className="fab fa-facebook-square text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Dashboard</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                  to={"/home"}
                >
                  <i className="fab fa-facebook-square text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Home</span>
                </Link>
              </li>
              {
                toggle.logOutBtn ? <button onClick={handleLogout} className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75">Logout</button> : <button onClick={handleLogin} className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75">Login</button>
              }
              {
                toggle.loginBtn ? <button onClick={handleLogin} className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75">Login</button> : <button onClick={handleLogout} className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75">Logout</button> 
              }

              {
                userData && <li className="nav-item">
                <Link to="/">
                  <small
                    className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-red-500 hover:opacity-75"
                    href="#pablo"
                  >
                    <i className="fab fa-pinterest text-lg leading-lg text-white opacity-75"></i><span className="ml-2">{userData ? userData.role: null +"("+ userData ? userData.firstName : null +")"}</span>
                  </small>

                </Link>

              </li>
              }

            </ul>

          </div>
        </div>
      </nav>
    </>
  );
}
